import '../App.css'
import axios from 'axios'

const AllOrders=()=>{
    const [orders,setOrders] = useState([]);
    useEffect(()=>{
        axios
        .get('http://jsonplaceholder.typicode.com/posts')
        .then(res=>{
            setOrders(res.data);
        })
    })

    return(
        <div>
{
    orders.map(order=>(
        <div className='flex-container'>
            <div className='card'>
                <img src="https://picsum.photos/300"/>
                <h1 className='row' key={order.id}>Ballentine</h1>
            </div>
        </div>
    ))
}
